DROP TABLE IF EXISTS `%DB_PREFIX%cate`;
CREATE TABLE `%DB_PREFIX%cate` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `pid` int(11) NOT NULL COMMENT '上级分类',
  `name` varchar(30) NOT NULL COMMENT '名称',
  `img` varchar(400) DEFAULT NULL COMMENT '图片',
  `url` varchar(400) DEFAULT NULL COMMENT '分类外部链接',
  `description` varchar(400) DEFAULT NULL COMMENT '分类描述',
  `sort` int(11) NOT NULL DEFAULT '0' COMMENT '排序',
  PRIMARY KEY (`id`),
  KEY `pid` (`pid`) USING BTREE,
  KEY `name` (`name`) USING BTREE
) ENGINE=MyISAM AUTO_INCREMENT=49 DEFAULT CHARSET=utf8 COMMENT='类别';
DROP TABLE IF EXISTS `%DB_PREFIX%deal_log`;
CREATE TABLE `%DB_PREFIX%deal_log` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT,
  `from_uid` bigint(20) DEFAULT '0' COMMENT '来源用户ID（邀请注册用）',
  `uid` bigint(20) DEFAULT NULL COMMENT '用户ID  对应%DB_PREFIX%web_user主键',
  `lid` bigint(20) DEFAULT NULL COMMENT '项目ID 对应%DB_PREFIX%loan表 主键',
  `invested_id` bigint(20) DEFAULT NULL COMMENT '投资ID 对应%DB_PREFIX%invested表主键',
  `money` double(20,2) NOT NULL COMMENT '交易金额',
  `type` int(1) DEFAULT NULL COMMENT '交易类型：1充值 2投资 3提现 4还款本金 5还款利息 6管理费 7奖励金额 8系统操作 9邀请奖励 10积分兑换',
  `pay_status` int(1) DEFAULT NULL COMMENT '收支状态  1收入 2支出',
  `detail` text COMMENT '交易明细',
  `create_time` int(11) DEFAULT NULL COMMENT '交易时间',
  `is_read` int(1) DEFAULT '0' COMMENT '阅读状态 0 未读 1 已读',
  `is_label` int(1) DEFAULT '0' COMMENT '标记  0 未标记 1 已标记',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=47822 DEFAULT CHARSET=utf8 COMMENT='资金交易记录表';
